import React from "react";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <div>
      <Navbar />
      <Route path = "/" element = {<Home />} />
      </div>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
